/**
 * Object containing spotify secrets. Should be kept secret!
 * @returns 
 */
const useSecrets = () => {
    const client_id = '00ec5f716a774d7ba0fd58833ec22323'; // Your client id
    const client_secret = 'a5544978b6314f4cab9efc731152862d';

    return (
        client_id,
        client_secret
    );
}

export default useSecrets;
